INSERT INTO `easymis_generator_template` VALUES ('45dca91b5dd54e7aa2f4e37cd62f5fb91517922283550', 'Dao模板', 'packagePath/dao/classNameDao.java', '2018-02-06 21:04:43', '2018-02-06 21:45:48', 'package ${package}.dao;\n\nimport ${package}.domain.${className}DO;\nimport java.util.List;\nimport com.ybg.base.jdbc.BaseMap;\nimport com.ybg.base.util.Page;\nimport  ${package}.domain.${className}DO;\nimport  ${package}.domain.${className}VO;\nimport  ${package}.qvo.${className}Query;\n/**\n * ${comments}\n * \n * @author ${author}\n * @email ${email}\n * @date ${datetime}\n */\npublic interface ${className}Dao {\n	 /** 返回主键的创建\n	 * \n	 * @throws Exception **/\n	${className}VO save(${className}VO bean) throws Exception;\n	\n	/** 更新数据，条件 和 需要更新的字段都不能为空 不限个数个条件\n	 * \n	 * @author Deament\n	 * @param updatemap\n	 *            需要更新的字段和值\n	 * @param wheremap\n	 *            更新中的条件字段和值\n	 * @param table_name\n	 *            表的名称 **/\n	// sys_role\n	void update(BaseMap<String, Object> updatemap, BaseMap<String, Object> wheremap);\n	\n	/** 分页查询 **/\n	// sys_role\n	Page list(Page page,${className}Query qvo)throws Exception;\n	\n	/** 不分页查询 **/\n	// sys_role\n	List<${className}VO> list(${className}Query qvo)throws Exception;\n	/** 根据条件删除 **/\n	void remove(BaseMap<String, Object> wheremap);\n	\n	${className}VO get(${pk.attrType} id);\n}\n', '1');
INSERT INTO `easymis_generator_template` VALUES ('51565f7bc9564111b5a7dbc200541bc61517922426824', '页面模板', '/main/resources/templates/system/className.html', '2018-02-06 21:07:06', '2018-02-06 21:19:21', '<html>\n<head>\n<\\#include \"/common/common2.ftl\"/>\n</head>\n<body>\n<div id=\"rrapp\" v-cloak>\n	<div v-show=\"showList\">\n	<div class=\"m-b-md\">\n	<form class=\"layui-form layui-form-pane\" role=\"form\" id=\"searchForm\" name=\"searchForm\">\n		<div class=\"layui-form-item\">\n					<!--	<label class=\"layui-form-label\">角色名:</label>\n						<div class=\"layui-input-inline\">\n							<input type=\"text\" name=\"name\" id=\"name\" lay-verify=\"required\" placeholder=\"请输入\" autocomplete=\"off\" class=\"layui-input\">\n						</div>-->\n		<a href=\"javascript:void(0)\" @click=\"reload\" class=\"layui-btn layui-btn-normal\" id=\"search\">查询</a>\n		<button type=\"button\" @click=\"del\" class=\"layui-btn layui-btn-danger\">删除</button>\n		<button type=\"button\" @click=\"add\" class=\"layui-btn layui-btn-normal\">新增</button>\n		<button type=\"button\" @click=\"update\" class=\"layui-btn layui-btn-normal\">编辑</button>\n		</div>\n	</form>\n	</div>\n		\n	    <div class=\"table-responsive\">\n			<table class=\"layui-hide\" id=\"${classname}table\"></table>\n		</div>\n    </div>\n    \n    <div v-show=\"!showList\" class=\"panel panel-default\">\n		<div class=\"panel-heading\">{{title}}</div>\n		<form class=\"layui-form layui-form-pane\">\n		<div class=\"panel-body\">\n		\n		#foreach($column in $columns)\n		#if($column.columnName != $pk.columnName)\n		<div class=\"layui-form-item\">\n			\n			   	<label class=\"layui-form-label\">${column.comments}</label>\n			   	<div class=\"layui-input-block\">\n			      <input type=\"text\" class=\"layui-input\" v-model=\"${classname}.${column.attrname}\" placeholder=\"${column.comments}\"/>\n			    </div>\n			</div>\n		#end\n		#end\n		</div>\n		<footer class=\"panel-footer text-right bg-light lter\">\n			<div class=\"layui-form-item\">\n				\n				<input type=\"button\" class=\"layui-btn layui-btn-normal\" @click=\"saveOrUpdate\" value=\"确定\"/>\n				&nbsp;&nbsp;<input type=\"button\" class=\"layui-btn layui-btn-danger\" @click=\"reload\" value=\"返回\"/>\n			</div>\n			</footer>\n		</form>\n	</div>\n</div>\n<script src=\"/你的JS路径/${pathName}.js\"></script>\n</body>\n</html>\n', '1');
INSERT INTO `easymis_generator_template` VALUES ('57894256f4fc4613b3cd9beeff4a28e01517921467879', 'DO模板', 'packagePath/domain/classNameDO.java', '2018-02-06 20:51:07', '2018-02-06 21:02:04', 'package ${package}.domain;\n\nimport java.io.Serializable;\nimport java.util.Date;\nimport io.swagger.annotations.ApiModel;\nimport io.swagger.annotations.ApiModelProperty;\n#if(${hasBigDecimal})\nimport java.math.BigDecimal;\n#end\n\n\n/**\n * ${comments}\n * \n * @author ${author}\n * @email ${email}\n * @date ${datetime}\n */\n @ApiModel(\"实体（数据库)\")\npublic class ${className}DO implements Serializable {\n	private static final long serialVersionUID = 1L;\n	\n#foreach ($column in $columns)\n	//$column.comments\n	@ApiModelProperty(name = \"${column.attrname}\", dataType = \"java.lang.$column.attrType\", value = \"${column.comments}\", hidden = false)\n	private $column.attrType $column.attrname;\n#end\n\n#foreach ($column in $columns)\n	/**\n	 * 设置：${column.comments}\n	 */\n	public void set${column.attrName}($column.attrType $column.attrname) {\n		this.$column.attrname = $column.attrname;\n	}\n	/**\n	 * 获取：${column.comments}\n	 */\n	public $column.attrType get${column.attrName}() {\n		return $column.attrname;\n	}\n#end\n}\n', '1');
INSERT INTO `easymis_generator_template` VALUES ('58b372b34bf6475dbad4b842f1eef6021517922365679', 'DaoImpl模板', 'packagePath/dao/classNameDaoImpl.java', '2018-02-06 21:06:05', '2018-02-06 21:17:09', 'package ${package}.dao;\n\nimport java.sql.PreparedStatement;\nimport java.sql.SQLException;\nimport java.util.ArrayList;\nimport java.util.List;\nimport org.springframework.jdbc.core.BatchPreparedStatementSetter;\nimport org.springframework.stereotype.Repository;\nimport com.ybg.base.jdbc.BaseDao;\nimport com.ybg.base.jdbc.BaseMap;\nimport com.ybg.base.jdbc.util.QvoConditionUtil;\nimport com.ybg.base.util.Page;\nimport ${package}.domain.${className}DO;\nimport ${package}.domain.${className}VO;\nimport ${package}.qvo.${className}Query;\nimport org.springframework.beans.factory.annotation.Autowired;\nimport org.springframework.beans.factory.annotation.Qualifier;\nimport org.springframework.jdbc.core.JdbcTemplate;\nimport com.ybg.base.jdbc.DataBaseConstant;\nimport org.springframework.jdbc.core.BeanPropertyRowMapper;\n@Repository\npublic class ${className}DaoImpl extends BaseDao implements ${className}Dao {\n@Autowired\n	@Qualifier(DataBaseConstant.JD_EDU)\n	JdbcTemplate jdbcTemplate;\n	\n	public JdbcTemplate getJdbcTemplate() {\n		return jdbcTemplate;\n	}\n\n\n	private static String  QUERY_TABLE_COLUMN= \"#foreach($column in $columns) #if($column.columnName != $pk.columnName)\n	  ${classname}.${column.columnName},#end#end ${classname}.${pk.columnName}\";\n	private static String  QUERY_TABLE_NAME=\"${tableName}  ${classname}\";\n	@Override\n	public ${className}VO save(${className}VO ${classname}) throws Exception {\n		BaseMap<String, Object> createmap = new BaseMap<String, Object>();\n		String id = null;		\n		#foreach($column in $columns)\n		#if($column.columnName != $pk.columnName)\n	  	createmap.put(\"${column.columnName}\", ${classname}.get${column.attrName}());\n		#end \n		#end \n		id = baseCreate(createmap, \"${tableName}\", \"${pk.columnName}\");\n		${classname}.set${pk.attrName}((${pk.attrType}) id);\n		return ${classname};\n	}\n	@Override\n	public void update(BaseMap<String, Object> updatemap,\n			BaseMap<String, Object> WHEREmap) {\n		this.baseupdate(updatemap, WHEREmap, \"${tableName}\");\n	}\n@Override\n	public Page list(Page page,  ${className}Query qvo)throws Exception {\n		StringBuilder sql = new StringBuilder();\n		sql.append(SELECT).append(QUERY_TABLE_COLUMN).append(FROM)\n				.append(QUERY_TABLE_NAME);\n		sql.append(getcondition(qvo));\n		page.setTotals(queryForInt(sql));\n		if (page.getTotals() > 0) {\n			page.setResult(getJdbcTemplate().query(page.getPagesql(sql),\n					 new BeanPropertyRowMapper<${className}VO>(${className}VO.class)));\n		} else {\n			page.setResult(new ArrayList< ${className}VO>());\n		}\n\n		return page;\n	}\n\n	private String getcondition( ${className}Query qvo) throws Exception{\n		StringBuilder sql = new StringBuilder();\n		sql.append(WHERE).append(\"1=1\");\n//		if (QvoConditionUtil.checkInteger(qvo.getIsdelete())) {\n//			sql.append(AND).append(\"${classname}.isdelete=\").append(qvo.getIsdelete());\n//		} else {\n//			sql.append(AND).append(\"${classname}.isdelete=0\");// 默认\n//		}\n        #foreach($column in $columns)\n		sqlappen(sql, \"${classname}.${column.columnName}\", qvo.get${column.attrName}());\n		#end	\n		return sql.toString();\n	}\n@Override\n	public List<${className}VO> list(${className}Query qvo) throws Exception{\n		StringBuilder sql = new StringBuilder();\n		sql.append(SELECT).append(QUERY_TABLE_COLUMN).append(FROM)\n				.append(QUERY_TABLE_NAME);\n		sql.append(getcondition(qvo));\n		return getJdbcTemplate().query(sql.toString(), new BeanPropertyRowMapper<${className}VO>(${className}VO.class));\n	}\n	\n	@Override\n	public void remove(BaseMap<String, Object> wheremap) {\n		 baseremove(wheremap, \"${tableName}\");		\n	}\n	@Override\n	public ${className}VO get(${pk.attrType} id){\n	\n	StringBuilder sql = new StringBuilder();\n		sql.append(SELECT).append(QUERY_TABLE_COLUMN).append(FROM)\n				.append(QUERY_TABLE_NAME);\n				sql.append(WHERE).append(\"1=1\");\n				sql.append(AND).append(\"${pk.columnName}=\'\"+id+\"\'\");\n		List<${className}VO> list=getJdbcTemplate().query(sql.toString(), new BeanPropertyRowMapper<${className}VO>(${className}VO.class));		\n		return QvoConditionUtil.checkList(list)?list.get(0):null;\n	}\n}\n', '1');
INSERT INTO `easymis_generator_template` VALUES ('6dbf622b90cb4c759eecac088b77f7c51517922222715', 'Controller模板', 'packagePath/controller/classNameController.java', '2018-02-06 21:03:42', '2018-02-06 21:17:21', 'package ${package}.controller;\nimport java.util.HashMap;\nimport java.util.Map;\nimport io.swagger.annotations.Api;\nimport io.swagger.annotations.ApiImplicitParam;\nimport io.swagger.annotations.ApiImplicitParams;\nimport io.swagger.annotations.ApiOperation;\nimport java.util.ArrayList;\nimport java.util.List;\nimport javax.servlet.http.HttpServletRequest;\nimport javax.servlet.http.HttpServletResponse;\nimport org.springframework.beans.factory.annotation.Autowired;\nimport org.springframework.http.MediaType;\nimport org.springframework.stereotype.Controller;\nimport org.springframework.ui.ModelMap;\nimport org.springframework.web.bind.annotation.ModelAttribute;\nimport org.springframework.web.bind.annotation.RequestMapping;\nimport org.springframework.web.bind.annotation.RequestMethod;\nimport org.springframework.web.bind.annotation.RequestParam;\nimport org.springframework.web.bind.annotation.ResponseBody;\nimport com.ybg.base.jdbc.BaseMap;\nimport org.springframework.web.bind.annotation.RequestBody;\nimport com.ybg.base.util.Json;\nimport com.ybg.base.util.Page;\nimport ${package}.domain.${className}VO;\nimport ${package}.service.${className}Service;\nimport ${package}.domain.${className}DO;\nimport ${package}.qvo.${className}Query;\nimport com.ybg.base.util.ValidatorUtils;\nimport org.springframework.http.ResponseEntity;\nimport org.springframework.http.HttpStatus;\nimport springfox.documentation.annotations.ApiIgnore;\n\n/**\n * ${comments}\n * \n * @author ${author}\n * @email ${email}\n * @date ${datetime}\n */\n @Api(\"${className}管理\")\n@Controller\n@RequestMapping(\"${pathName}\")\npublic class ${className}Controller {\n	@Autowired\n	private ${className}Service ${classname}Service;\n		\n	@ApiOperation(value = \"${className}管理页面\", notes = \"\", produces = MediaType.TEXT_HTML_VALUE)\n	@RequestMapping(value = { \"index.do\" }, method = { RequestMethod.GET, RequestMethod.POST })\n	public String index() {		\n		return \"/system/${classname}/index\";\n	}\n	\n	@ApiOperation(value = \"${className}分页列表\", notes = \"JSON \", produces = MediaType.APPLICATION_JSON_VALUE)\n	//@ApiImplicitParams({ @ApiImplicitParam(name = \"pageNow\", value = \"当前页数\", required = true, dataType = \"Integer\"), @ApiImplicitParam(name = \"qvo\", value = \"查询页数\", required = false, dataType = \"${className}Qvo\") })\n	@ResponseBody\n	@RequestMapping(value = { \"list.do\" }, method = { RequestMethod.GET, RequestMethod.POST })\n	public Page list(@ModelAttribute ${className}Query qvo, @ModelAttribute Page page, ModelMap map) throws Exception {\n		qvo.setBlurred(true);\n	//	Page page = new Page();\n	//	page.setCurPage(pageNow);\n		page = ${classname}Service.list(page, qvo);\n		page.init();\n		return page;\n	}\n		\n	@ApiOperation(value = \"更新${className}\", notes = \"\", produces = MediaType.APPLICATION_JSON_VALUE)\n	@ResponseBody\n	@RequestMapping(value = { \"update.do\" }, method = { RequestMethod.GET, RequestMethod.POST })\n	public Json update(@RequestBody ${className}VO ${classname}) {\n		Json j = new Json();\n		j.setSuccess(true);\n		ValidatorUtils.validateEntity(${classname});\n		try {\n			BaseMap<String, Object> updatemap = new BaseMap<String, Object>();\n			#foreach($column in $columns)\n			#if($column.columnName != $pk.columnName)\n	  		updatemap.put(\"${column.columnName}\", ${classname}.get${column.attrName}());\n			#end \n			#end \n			BaseMap<String, Object> wheremap = new BaseMap<String, Object>();			\n			wheremap.put(\"id\", ${classname}.get${pk.attrName}());			\n			${classname}Service.update(updatemap, wheremap);\n		} catch (Exception e) {\n			e.printStackTrace();\n			j.setMsg(\"操作失败\");\n			return j;\n		}\n		j.setMsg(\"操作成功\");\n		return j;\n	}\n	\n	@ApiOperation(value = \"根据ID删除${classname}\", notes = \" \", produces = MediaType.APPLICATION_JSON_VALUE)\n	@ApiImplicitParam(name = \"ids\", value = \"删除${classname}\", required = true, dataType = \"java.lang.String\")\n	@ResponseBody\n	@RequestMapping(value = { \"remove.do\" }, method = { RequestMethod.GET, RequestMethod.POST })\n	public Json remove(@RequestParam(name = \"ids\", required = true) String ids2) {\n		Json j = new Json();\n		j.setSuccess(true);\n		try {\n			String[] ids = ids2.split(\",\");\n			for (String id : ids) {\n				BaseMap<String, Object> wheremap= new BaseMap<String, Object>();\n				wheremap.put(\"${pk.attrname}\", id);\n				${classname}Service.remove(wheremap);\n			}\n		} catch (Exception e) {\n			e.printStackTrace();\n			j.setMsg(\"操作失败\");\n			return j;\n		}\n		j.setMsg(\"操作成功\");\n		return j;\n	}\n	\n	@ApiOperation(value = \"创建${classname}\", notes = \" \", produces = MediaType.APPLICATION_JSON_VALUE)\n	@ResponseBody\n	@RequestMapping(value = { \"create.do\" }, method = { RequestMethod.GET, RequestMethod.POST })\n	public Json create(@RequestBody ${className}VO bean) {\n		Json j = new Json();\n		j.setSuccess(true);\n		ValidatorUtils.validateEntity(bean);\n		try {\n			${classname}Service.save(bean);\n		} catch (Exception e) {\n			e.printStackTrace();\n			j.setMsg(\"操作失败\");\n			return j;\n		}\n		j.setMsg(\"操作成功\");\n		return j;\n	}\n	\n	@ApiOperation(value = \"获取单个${className}\", notes = \"\", produces = MediaType.APPLICATION_JSON_VALUE)\n	@ApiImplicitParams({ @ApiImplicitParam(name = \"id\", value = \"用户ID\", required = true, dataType = \"java.lang.String\") })\n	@RequestMapping(value = { \"get.do\" }, method = { RequestMethod.GET, RequestMethod.POST })\n	public ResponseEntity<Map<String, Object>> get(@RequestParam(name = \"id\", required = true) String id) throws Exception {\n		Map<String, Object> result = new HashMap<String, Object>();\n		${className}VO bean = ${classname}Service.get(id);		\n		result.put(\"${classname}\", bean);\n		ResponseEntity<Map<String, Object>> map = new ResponseEntity<Map<String, Object>>(result, HttpStatus.OK);\n		return map;\n	}\n	\n	\n}\n', '1');
INSERT INTO `easymis_generator_template` VALUES ('7961f0184fed4b8081c7a3dbef7ba8231517922706518', 'JS模板', '/main/resources/static/system/className.js', '2018-02-06 21:11:46', '2018-02-06 21:19:31', 'var vm = new Vue({\n	el:\'#rrapp\',\n	data:{\n		showList: true,\n		title: null,\n		${classname}: {}\n	},\n	methods: {\n		query: function () {\n			vm.reload();\n		},\n		add: function(){\n			vm.showList = false;\n			vm.title = \"新增\";\n			vm.${classname} = {};\n		},\n		update: function (event) {\n			var $pk.attrname = getSelectedRow(\'${classname}table\',\'${pk.attrname}\');\n			if($pk.attrname == null){\n				return ;\n			}\n			vm.showList = false;\n            vm.title = \"修改\";\n            \n            vm.getInfo(${pk.attrname})\n		},\n		saveOrUpdate: function (event) {\n			var url = vm.${classname}.${pk.attrname} == null ? \"${pathName}create.do\" : \"${pathName}update.do\";\n			$.ajax({\n				type: \"POST\",\n			    url: rootPath + url,\n                contentType: \"application/json\",\n			    data: JSON.stringify(vm.${classname}),\n			    success: function(r){\n				vm.reload();\n				alert(r.msg);\n			    	\n				}\n			});\n		},\n		del: function (event) {\n			var ${pk.attrname}s = getSelectedRows(\'${classname}table\',\'${pk.attrname}\');\n			if(${pk.attrname}s == null){\n				return ;\n			}			\n			confirm(\'确定要删除选中的记录？\', function(){\n				$.ajax({\n					type: \"POST\",\n				    url: rootPath + \"${pathName}remove.do\",\n				    data : {\n                        ids : ${pk.attrname}s\n                    },				   \n				    success: function(r){\n						\n							alert(r.msg);\n						\n					}\n				});\n			});\n		},\n		getInfo: function(${pk.attrname}){\n			$.get(rootPath + \"${pathName}get.do?id=\"+${pk.attrname}, function(r){\n                vm.${classname} = r.${classname};\n            });\n		},\n		reload: function (event) {\n			\n	            vm.showList = true;\n	           layui.use(\'table\', function() {\n                var table = layui.table;\n               