DROP TABLE IF EXISTS `easymis_member`;
CREATE TABLE `easymis_member` (
  `member_id` varchar(40) NOT NULL,
  `org_id` varchar(40) default NULL,
  `member_name` varchar(255) default NULL COMMENT '用户名|账号',
  `name` varchar(255) default NULL COMMENT '姓名|真实姓名',
  `nickname` varchar(100) default NULL COMMENT '昵称',
  `password` varchar(255) default NULL,
  `gender` tinyint(1) default '2' COMMENT '性别1男0女2保密',
