  `freezed_value` int(11) unsigned default NULL COMMENT '冻结积分',
  `balance` float(255,2) default NULL COMMENT '余额(delete)',
  `money` decimal(10,2) default NULL COMMENT '现金账户：用户现有资金(余额)',
  `frozen_money` decimal(10,2) default NULL COMMENT '现金账户：用户冻结资金',
  `sign_in_times` int(11) unsigned default '0' COMMENT '连续签到天数',
  `sign_in_date` datetime default NULL COMMENT '上次签到日期',
  `sign_in_time_all` int(11) default '0' COMMENT '总签到次数',
  `update_password_time` datetime default NULL COMMENT '最后密码修改时间',
  `login_failure_count` int(11) unsigned default '0' COMMENT '登录失败次数',
  `session_id` varchar(45) default NULL COMMENT '会话id，SessionId',
