  `register_time` datetime default NULL COMMENT '注册时间',
  `register_ip` varchar(255) default NULL COMMENT '注册IP',
  `last_login_time` datetime default NULL COMMENT '最后登录时间',
  `last_login_ip` varchar(255) default NULL COMMENT '最后登录IP',
  `login_count` int(11) default NULL COMMENT '登录次数',
  `rank` int(255) default NULL COMMENT '管理员级别',
  `upload_total` bigint(255) default NULL COMMENT '上传总大小',
  `upload_size` int(11) default NULL COMMENT '上传大小',
  `upload_date` datetime default NULL COMMENT '上传日期',
  `is_admin` tinyint(1) default NULL COMMENT '是否管理员',
  `is_self_admin` tinyint(1) default NULL COMMENT '是否只管理自己的数据1是0否',
  `is_disabled` tinyint(1) default '1' COMMENT '是否禁用1禁用0否',
  `status` int(255) default NULL COMMENT '会员状态0初始1审核中2已审批3审批不通过',
  `user_type` varchar(255) default NULL COMMENT '用户类型(1个人、2企业机构、3商户、4店小二)',
  `company_name` varchar(255) default NULL COMMENT '公司名称',
  `company_address` varchar(255) default NULL COMMENT '公司地址',
  `handler_office` varchar(255) default NULL COMMENT '法人',
  `company_telephone` varchar(255) default NULL COMMENT '公司电话',
  `company_url` varchar(255) default NULL COMMENT '网站',
  `company_logo` varchar(255) default NULL COMMENT '公司logo|组织logo',
  `hobby` varchar(255) default NULL COMMENT '兴趣爱好',
  `country_id` int(11) default NULL COMMENT '地址_国别',
  `country_name` varchar(255) default NULL COMMENT '国名',
  `province_id` int(11) default NULL COMMENT '地址_省市',
  `province_name` varchar(255) default NULL,
  `city_id` int(11) default NULL COMMENT '地址_地市',
  `city_name` varchar(255) default NULL COMMENT '城市名',
  `district_id` int(11) default NULL COMMENT '地址_区县',
  `district_name` varchar(255) default NULL COMMENT '区县名',
  `avatar` varchar(255) default NULL COMMENT '头像照片',
  `experience` varchar(255) default NULL COMMENT '经验值',
  `rank_number` int(11) default NULL COMMENT '等级编号',
  `rank_change_date` datetime default NULL COMMENT '等级变更日期',
  `now_integral` varchar(255) default NULL COMMENT '当年剩余积分',
  `login_fail_times` int(11) default NULL COMMENT '登录失败次数',
  `unlock_date` datetime default NULL COMMENT '解锁时间',
  `email_activation_sign` varchar(255) default NULL COMMENT '邮箱激活标识',
  `mobile_activation_sign` varchar(255) default NULL COMMENT '手机激活标识',
  `company_verify_state` int(255) default NULL COMMENT '企业审核状态 1=准入受理',
  `verify_depict` varchar(500) default NULL COMMENT '审核意见',
  `reg_capital` varchar(255) default NULL COMMENT '注册资金',
  `contact_person` varchar(255) default NULL COMMENT '联系人姓名',
  `contact_mobile` varchar(11) default NULL COMMENT '联系人电话',
  `verify_type_id` varchar(20) default NULL COMMENT '认证级别1注册2认证3达人',
  `certificate_id` varchar(20) default NULL COMMENT '证件类型',
  PRIMARY KEY  (`member_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='CMS用户扩展信息表';

