  `contact` varchar(50) default NULL,
  `mobile` varchar(20) default NULL COMMENT '联系手机',
  `create_time` datetime NOT NULL COMMENT '创建时间|注册时间',
  `start_date` datetime default NULL COMMENT '启用时间',
  `trial_finish_time` datetime default NULL COMMENT '试用结束日期',
  `country_id` varchar(40) default NULL,
  `country_name` varchar(255) default NULL,
  `province_id` varchar(40) default NULL,
  `province_name` varchar(255) default NULL,
  `city_id` varchar(40) default NULL,
  `city_name` varchar(255) default NULL,
  `district_id` varchar(40) default NULL,
  `district_name` varchar(255) default NULL,
  `register_address` varchar(255) default NULL COMMENT '注册地址',
  `office_address` varchar(255) default NULL COMMENT '办公地址',
  `phone` varchar(255) default NULL COMMENT '联系电话',
  `fax` varchar(255) default NULL,
  `zip` varchar(255) default NULL,
  `total_staff` int(11) default NULL COMMENT '该组织最多支持用户',
  `used_staff` int(11) default '1' COMMENT '该组织已共享用户数|已使用用户数',
  `status` tinyint(11) NOT NULL default '1' COMMENT '启用状态1启用2停用',
  `depict` varchar(1000) default NULL,
  `business_license_no` int(40) default NULL COMMENT '企业执照号',
  `legal_person` varchar(40) default NULL COMMENT '企业法人',
  `registered_capital` varchar(255) default NULL COMMENT '注册资本',
  `business_scope` varchar(255) default NULL COMMENT '经营范围',
  `email` varchar(50) default NULL COMMENT '联系人邮箱',
  `ipo` varchar(255) default NULL COMMENT '是否上市',
  `stock_code` varchar(255) default NULL COMMENT '股票代码',
  `bank_no` varchar(40) default NULL COMMENT '银行账号',
  `bank_name` varchar(255) default NULL COMMENT '开户行',
  `url` varchar(255) default NULL COMMENT '网站',
  `blog` varchar(255) default NULL COMMENT '博客',
  `level1_industry_id` varchar(40) default NULL,
  `level2_industry_id` varchar(40) default NULL,
  `level3_industry_id` varchar(40) default NULL,
  `level4_industry_id` varchar(40) default NULL,
  `level1_industry_name` varchar(255) default NULL,
  `level2_industry_name` varchar(255) default NULL,
  `level3_industry_name` varchar(255) default NULL,
  `level4_industry_name` varchar(255) default NULL,
  `origin` int(11) default NULL COMMENT '来源1门户网站注册2百度推广',
  `ownership` int(11) default NULL COMMENT '企业类型(1合资,2国企,3民营)',
  `annual_revenue` varchar(40) default NULL COMMENT '年营业额',
  `qq` varchar(20) default NULL,
  `we_chat` varchar(40) default NULL,
  `update_id` varchar(40) default NULL,
  `update_name` varchar(40) default NULL,
  `update_time` datetime default NULL,
  `delete_status` int(11) default '1' COMMENT '删除状态1正常2删除|作废',
  `delete_id` varchar(40) default NULL,
  `delete_name` varchar(40) default NULL,
  `delete_time` datetime default NULL,
  `lock_status` int(11) NOT NULL default '1' COMMENT '锁定状态1锁定2解锁',
  `ip_gateway` int(11) NOT NULL default '1' COMMENT 'IP黑白名单设置1关闭2开启白名单3开启黑名单',
  PRIMARY KEY  (`org_id`),
  KEY `organize_uk_$1` USING BTREE (`org_name`),
  KEY `organize_uk_$2` (`org_no`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

