-- ----------------------------
-- Table structure for easymis_schedule_job
-- ----------------------------
DROP TABLE IF EXISTS `easymis_schedule_job`;
CREATE TABLE `easymis_schedule_job` (
  `job_id` varchar(40) NOT NULL COMMENT '任务id',
  `org_id` varchar(40) default NULL,
  `bean_name` varchar(200) default NULL COMMENT 'spring bean名称',
  `method_name` varchar(100) default NULL COMMENT '方法名',
  `params` varchar(2000) default NULL COMMENT '参数',
  `cron_expression` varchar(100) default NULL COMMENT 'cron表达式',
  `status` tinyint(4) default NULL COMMENT '任务状态  0：正常  1：暂停',
  `remark` varchar(255) default NULL COMMENT '备注',
  `creator_id` varchar(40) default NULL,
  `creator_name` varchar(50) default NULL COMMENT '创建者',
  `create_time` datetime default NULL COMMENT '创建时间',
  `update_id` varchar(40) default NULL,
  `update_name` varchar(50) default NULL COMMENT '修改者',
  `update_time` datetime default NULL COMMENT '修改时间',
  PRIMARY KEY  (`job_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='定时任务';

-- ----------------------------
-- Records of easymis_schedule_job
-- ----------------------------

-- ----------------------------
-- Table structure for easymis_schedule_job_log
-- ----------------------------
DROP TABLE IF EXISTS `easymis_schedule_job_log`;
CREATE TABLE `easymis_schedule_job_log` (
  `log_id` varchar(40) NOT NULL COMMENT '任务日志id',
  `job_id` varchar(40) default NULL COMMENT '任务id',
  `org_id` varchar(40) default NULL COMMENT '保留字段',
  `bean_name` varchar(200) default NULL COMMENT 'spring bean名称',
  `method_name` varchar(100) default NULL COMMENT '方法名',
  `params` varchar(2000) default NULL COMMENT '参数',
  `status` int(4) default NULL COMMENT '任务状态    0：成功    1：失败',
  `error` varchar(2000) default NULL COMMENT '失败信息',
  `run_time` int(11) default NULL COMMENT '耗时(单位：毫秒)',
  `create_time` datetime default NULL COMMENT '创建时间',
  PRIMARY KEY  (`log_id`),
  KEY `job_id` (`job_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='定时任务日志';

-- ----------------------------
-- Records of easymis_schedule_job_log
-- ----------------------------

