  `category` int(1) default NULL COMMENT '类别1目录2菜单3按钮',
  `group_id` varchar(40) default NULL COMMENT '应用分组',
  `group_name` varchar(50) default NULL COMMENT '应用分组名',
  `display_name` varchar(1032) default NULL,
  `detail` varchar(200) default NULL,
  `url` varchar(64) default NULL,
  `priority` int(11) default NULL,
  `depict` varchar(200) character set utf8 collate utf8_bin default '' COMMENT '备注',
  `icon` varchar(200) default NULL,
  `free_status` int(11) NOT NULL default '1' COMMENT '免费状态1开启2关闭',
  `due_date` datetime default NULL COMMENT '付费应用到期日',
  `status` int(1) NOT NULL default '1' COMMENT '状态1启用2禁用',
  PRIMARY KEY  (`function_id`),
  UNIQUE KEY `organize_function_uk_$1` USING BTREE (`org_id`,`sys_code`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='系统菜单表';

