  `log_id` int(11) NOT NULL auto_increment,
  `org_id` varchar(40) default NULL COMMENT '保留字段',
  `org_name` varchar(50) default NULL COMMENT '保留字段',
  `username` varchar(45) default NULL COMMENT '用户名|员工名',
  `site_id` varchar(40) default NULL COMMENT '保留字段',
  `category` varchar(40) default '0' COMMENT '日志类型|保留字段',
  `create_time` datetime default NULL COMMENT '日志时间|登录时间|创建时间',
  `ip` varchar(50) default NULL COMMENT 'IP地址',
  `url` varchar(255) default NULL COMMENT 'URL地址',
  `operation` varchar(50) default NULL,
  `method` varchar(255) default NULL COMMENT '请求方法',
  `params` varchar(500) default NULL COMMENT '请求参数',
  `session_id` varchar(45) default NULL COMMENT '会话id',
  `login_failure_count` int(11) unsigned default '0' COMMENT '登录失败次数|保留字段',
  `lock_time` datetime default NULL COMMENT '锁定时间|保留字段',
  `run_time` bigint(11) default '0' COMMENT '执行时长(毫秒)',
  `status` int(11) NOT NULL default '1' COMMENT '日志状态|任务状态1成功 0失败',
